import React from "react";
import { Link } from "react-router-dom";
import "./navbar.css";
import { useState } from "react";
import SignUp from "./signupPage.js";
import LogIn from "./loginPage.js";

const Navbar = () => {
  const [loginPopup, loginIsOpen] = useState(false);
  const [signupPopup, signupIsOpen] = useState(false);
  return (
    <div>
      <nav className="header">
        <ul className="nav-left">
          <li>
            <Link to="/">
              <img src="/eventlylogo.svg" alt="evently logo" />
            </Link>
          </li>
          <li>
            <Link to="/home">Evently</Link>
          </li>
        </ul>
        <ul className="nav-right">
          <li>
            <Link onClick={openLogIn} to="/loginPage">
              Log In
            </Link>
          </li>
          <li>
            <Link onClick={openSignUp} to="/signupPage">
              Sign Up
            </Link>
          </li>
          <li>
            <Link to="/profile">
              <img src="/profilelogo.svg" alt="profile" />
            </Link>
          </li>
        </ul>
      </nav>
      <div></div>
    </div>
  );
};

export default Navbar;
